import React from 'react';
import {  Card, Col, Row } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';



const Route = ({title, waterLevel, duration, cost, learn, pic, setRoute}) => {




  return (
    <Col sm={4} >
        <Card.Body onClick={() => setRoute(title)} className={pic}>
            <Row>
                <Col className='text'>
                    <h6><FontAwesomeIcon icon="map-marker-alt"  size="1x" /> {title}</h6>
                    <h6><FontAwesomeIcon icon="clock"  size="1x" /> {duration}hrs</h6>
                    <h6><FontAwesomeIcon icon="dollar-sign"  size="1x" /> {cost}</h6>  
                    <h6><FontAwesomeIcon icon="water"  size="1x" /> {waterLevel}ft</h6>
                    <h6><FontAwesomeIcon icon="plus"  size="1x" /> {learn} Learn More</h6>
                </Col>
                <Col></Col>
                <Col></Col>
            </Row>
        </Card.Body>
    </Col>  
  );
};

export default Route;
